contracts/mojo.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@thirdweb-dev/contracts/base/ERC20Base.sol";

/**
 * @title Mojo Token
 * @notice ERC20 token for Producer Protocol on Optimism with dynamic minting.
 *         Replaces PJK via swap/burn mechanism.
 */
contract Mojo is ERC20Base {
    string public constant DESIGNATOR = "ProducerProtocolMainToken";
    address public swapContract; // Address allowed to mint Mojo
    uint256 public swapRatio = 1; // 1 PJK = 1 Mojo (adjustable)

    enum Role { Artist, Fan }

    struct Contribution {
        address contributor;
        Role role;
        uint256 percentage;
        uint256 timestamp;
    }

    mapping(bytes32 => Contribution[]) public projectContributions;

    event ContributionRecorded(bytes32 indexed projectId, address indexed contributor, Role role, uint256 percentage);
    event TokensBurned(address indexed burner, uint256 amount);
    event TokensMintedForSwap(address indexed user, uint256 pjkAmount, uint256 mojoAmount);

    /**
     * @notice Constructor sets initial owner and swap contract.
     * @param _initialOwner Address with owner privileges (e.g., 0x2af17552f27021666BcD3E5Ba65f68CB5Ec217fc).
     */
    constructor(address _initialOwner) 
        ERC20Base(_initialOwner, "Mojo", "MOJO") 
    {
        require(_initialOwner == 0x2af17552f27021666BcD3E5Ba65f68CB5Ec217fc, "Invalid initial owner");
        swapContract = _initialOwner; // Initially owner, update to swap contract later
    }

    /**
     * @notice Allocate tokens and record contribution (owner-only).
     */
    function allocateContribution(
        address to,
        uint256 amount,
        bytes32 projectId,
        Role role,
        uint256 percentage
    ) external onlyOwner {
        require(to != address(0), "Invalid recipient");
        _mint(to, amount); // Dynamic minting for contributions
        projectContributions[projectId].push(
            Contribution({
                contributor: to,
                role: role,
                percentage: percentage,
                timestamp: block.timestamp
            })
        );
        emit ContributionRecorded(projectId, to, role, percentage);
    }

    /**
     * @notice Mint Mojo for PJK swapped/burned (called by swap contract).
     * @param user Address receiving Mojo.
     * @param pjkAmount Amount of PJK burned on Polygon.
     */
    function mintForSwap(address user, uint256 pjkAmount) external onlySwapContract {
        uint256 mojoAmount = pjkAmount * swapRatio;
        _mint(user, mojoAmount);
        emit TokensMintedForSwap(user, pjkAmount, mojoAmount);
    }

    /**
     * @notice Burn Mojo tokens.
     */
    function burn(uint256 amount) external override {
        _burn(msg.sender, amount);
        emit TokensBurned(msg.sender, amount);
    }

    /**
     * @notice Update swap contract address.
     */
    function setSwapContract(address _swapContract) external onlyOwner {
        require(_swapContract != address(0), "Invalid address");
        swapContract = _swapContract;
    }

    /**
     * @notice Update swap ratio.
     */
    function setSwapRatio(uint256 _ratio) external onlyOwner {
        require(_ratio > 0, "Invalid ratio");
        swapRatio = _ratio;
    }

    modifier onlySwapContract() {
        require(msg.sender == swapContract, "Only swap contract allowed");
        _;
    }
}

contracts/mojoswap.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "./mojo.sol";

/**
 * @title MojoSwap
 * @notice Handles PJK burn events from Polygon and mints Mojo on Optimism.
 */
contract MojoSwap {
    Mojo public mojoToken;
    address public owner;
    // Simplified: Assume an oracle or bridge sets this after verifying Polygon burn
    mapping(address => uint256) public pendingSwaps;

    event SwapRequested(address indexed user, uint256 pjkAmount);
    event SwapCompleted(address indexed user, uint256 pjkAmount, uint256 mojoAmount);

    constructor(address _mojoToken) {
        mojoToken = Mojo(_mojoToken);
        owner = msg.sender;
    }

    /**
     * @notice Request swap (called after burning PJK on Polygon).
     * @param pjkAmount Amount burned, verified off-chain or via bridge.
     */
    function requestSwap(uint256 pjkAmount) external {
        pendingSwaps[msg.sender] += pjkAmount;
        emit SwapRequested(msg.sender, pjkAmount);
    }

    /**
     * @notice Complete swap by minting Mojo (owner or oracle calls after verification).
     */
    function completeSwap(address user, uint256 pjkAmount) external onlyOwner {
        require(pendingSwaps[user] >= pjkAmount, "Insufficient pending amount");
        pendingSwaps[user] -= pjkAmount;
        mojoToken.mintForSwap(user, pjkAmount);
        emit SwapCompleted(user, pjkAmount, pjkAmount * mojoToken.swapRatio());
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }
}

contracts/pjkburner.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title PJKBurner
 * @notice Burns PJK tokens on Polygon to trigger Mojo minting on Optimism.
 */
contract PJKBurner {
    IERC20 public pjkToken = IERC20(0xfc0E40e7D6AbA1079409966bcAcB2273f048Da5F);
    address public constant BURN_ADDRESS = 0x000000000000000000000000000000000000dEaD;

    event PJKBurned(address indexed user, uint256 amount);

    /**
     * @notice Burns PJK tokens by sending them to a dead address.
     * @param amount Amount of PJK to burn.
     */
    function burnPJK(uint256 amount) external {
        require(pjkToken.transferFrom(msg.sender, BURN_ADDRESS, amount), "PJK burn failed");
        emit PJKBurned(msg.sender, amount);
    }
}

